    /**
     * Function:
     *         RVA    -> 0x00000000
     *         Name   -> 
     *         Flags  -> ()
     * Parameters:
     *         void                                               ReturnValue
     *         CoreUObject::FVector&                              angle
     */
    void FVector::Normalize360(CoreUObject::FVector& angle)
    {
        const float maxX1 = 80.0f;
        
        while (angle.X > maxX1)
            angle.X -= 180.0f;
        while (angle.X < -maxX1)
            angle.X += 180.0f;
        while (angle.Y > 180.0f)
            angle.Y -= 360.0f;
        while (angle.Y < -180.0f)
            angle.Y += 360.0f;
    }

